import React from "react";
import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardSubTitle,
  MDBCardText,
  MDBCol,
  MDBContainer,
  MDBRow,
} from "mdb-react-ui-kit";

class Partner extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  // Beinhalten bereits this.setState() Methode
  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <MDBCard>
        <MDBCardBody>
          <MDBContainer>
            <MDBRow>
              <MDBCol>
                <MDBCardTitle>{this.props.title}</MDBCardTitle>
              </MDBCol>
              <MDBCol>
                <MDBBtn
                  className="float-end btn-close"
                  color="none"
                  onClick={() => this.props.onDelete(this.props.id)}
                ></MDBBtn>
              </MDBCol>
            </MDBRow>

            <MDBCardSubTitle>Hinzugefügt am {this.props.added}</MDBCardSubTitle>
            <br />
          </MDBContainer>
          <MDBContainer>
            <MDBRow>
              <MDBCol>
                <MDBCardText>
                  {this.props.addressName}
                  <br />
                  {this.props.addressStreet}
                  <br />
                  {this.props.addressCity}, {this.props.addressCountry}
                </MDBCardText>
              </MDBCol>
              <MDBCol>
                <MDBCardText>
                  📧 {this.props.email}
                  <br />☎ {this.props.phone}
                  <br />
                  EORI-Nr.: {this.props.eori}
                </MDBCardText>
              </MDBCol>
            </MDBRow>
            <br />
            <MDBRow>
              <MDBCol md="8" lg="9">
                <div className="alert alert-warning" role="alert">
                  2 Aufträge insgesamt, davon 1 Auftrag in Bearbeitung.
                </div>
              </MDBCol>
              <MDBCol md="4" lg="3">
                <MDBBtn className="float-end">Auftragsübersicht</MDBBtn>
              </MDBCol>
            </MDBRow>
          </MDBContainer>
        </MDBCardBody>
      </MDBCard>
    );
  }
}

export default Partner;
